syntax = "proto3";
package POGOProtos;

message CompleteCompetitiveSeasonOutProto {
	Result result = 1;
	LootProto loot_proto = 2;
	int32 new_rank = 3;
	float new_rating = 4;

	enum Result {
		UNSET = 0;
		SUCCESS = 1;
		ERROR_PLAYER_HAS_NO_VS_SEEKER = 2;
		ERROR_REWARDS_ALREADY_COLLECTED = 3;
	}
}
